data.value:
Αναγνωριστικό Άδειας, ως παγκοσμίως μοναδικός αναγνωριστικός για μια άδεια ή σύμβαση κάτω από την οποία παράγονται αντικείμενα, υποβάλλονται για επεξεργασία και/ή πληρώνονται, που δημιουργείται από τη σύνθεση:
 - ενός κωδικού εκδότη ISO/IEC 15459;
 - ενός αριθμού άδειας ή σύμβασης που συμμορφώνεται με τις προδιαγραφές του εκδότη που αφορά;
 και που:
 - περιλαμβάνει μόνο κεφαλαία αλφαβητικά και/ή αριθμητικά χαρακτήρες;
 - είναι μοναδικό (δηλαδή, διαφέρει από οποιοδήποτε άλλο αναγνωριστικό συμμορφωμένο με το ISO/IEC 15459) εντός του τομέα του εκδότη;
 - δεν μπορεί να προκύψει από οποιοδήποτε άλλο αναγνωριστικό συμμορφωμένο με το ISO/IEC 15459, εκδοθέν κάτω από τον ίδιο εκδότη, με την απλή προσθήκη χαρακτήρων στο τέλος του, ή την αφαίρεσή τους από αυτό.

Κωδικός περιοχής αλιείας FAO όπως ορίζεται από το Τμήμα Αλιείας και Υδατοκαλλιέργειας του FAO (http://www.fao.org. Αναζήτηση για την υπο-ιστοσελίδα Κωδικός Περιοχής Αλιείας).
Επιτρέπονται όλοι οι χαρακτήρες του υποσυνόλου ISO/IEC 646 που ορίζεται από την GS1 General Specification.
Παραδείγματα:
18L37.1.3 Δυτική Μεσόγειος Θάλασσα, Σαρδηνία;
18L47.B.1 Ατλαντικός, Νοτιοανατολικό, Διαίρεση SEAFO, Οικονομική Ζώνη Ναμίμπιας;
18L67 Ειρηνικός, Βορειοανατολικό.

Πινακίδα Άδειας με Δεδομένα Υπηρεσίας και Κωδικό Τοποθεσίας είναι μια σύνθετη δομή δεδομένων, συμβατή με την προδιαγραφή στο πρότυπο UPU S25, που περιλαμβάνει προδιαγραφή:
 - ενός αναγνωριστικού αντικειμένου σύμφωνο με το ISO/IEC 15459;
 - ενός αναγνωριστικού δεδομένων 5U συμβατής προδιαγραφής της υπηρεσίας που πρέπει να παρέχεται σε σχέση με το αντικείμενο;
 - ενός αναγνωριστικού δεδομένων 17U συμβατού κωδικού τοποθεσίας UPU ή ενός αναγνωριστικού δεδομένων 18U συμβατού προσόντων κωδικού τοποθεσίας UPU.
 Σημείωση - Για περαιτέρω λεπτομέρειες, παρακαλώ ανατρέξτε στο πρότυπο UPU S25. Η διάκριση μεταξύ ενός απλού κωδικού τοποθεσίας UPU (DI 17U) και ενός προσόντος κωδικού τοποθεσίας UPU (DI 18U) μπορεί να προσδιοριστεί από τον πρώτο χαρακτήρα. Εάν αυτός είναι αριθμητικός, ισχύει ο 18U; εάν είναι αλφαβητικός, ισχύει ο 17U.

Εκδήλωση, Ημερομηνία, Και Ώρα.
Μορφή YYYYMMDDHHMM (24ωρο ρολόι - UTC) αμέσως ακολουθούμενη από έναν Κωδικό Προσόντων UN/EDIFACT 2005 παρέχοντας έναν κωδικό που προσδιορίζει τον τύπο της ημερομηνίας), π.χ.,
11 [Ημερομηνία που αναμένεται να αποσταλούν/αποστέλλονται τα αγαθά το μήνυμα εκδίδεται.];
17 [Εκτιμώμενη ημερομηνία/ώρα παράδοσης όταν αναμένεται να παραδοθούν τα αγαθά];
35 [Ημερομηνία κατά την οποία τα αγαθά παραδίδονται στον προορισμό τους.];
118 [Επιβεβαίωση Κράτησης];
129 [Ημερομηνία όταν το πλοίο/εμπορεύματα αναχώρησαν από το τελευταίο ξένο λιμάνι στη χώρα εξαγωγής.];
132 [Ημερομηνία/ώρα όταν ο μεταφορέας εκτιμά ότι ένα μέσο μεταφοράς θα φτάσει στο λιμάνι αποβίβασης ή στον τόπο προορισμού.];
133 [Ημερομηνία/ώρα όταν ο μεταφορέας εκτιμά ότι ένα μέσο μεταφοράς θα αναχωρήσει από τον τόπο αναχώρησης];
137 [Ημερομηνία/ώρα όταν ο προμηθευτής στέλνει μέρη βάσει του αιτήματος του πελάτη. (Ημερομηνία όταν εκδίδεται το μήνυμα DESADV. Η σύσταση είναι το DESADV να εκδίδεται εντός 30 λεπτών από τη συλλογή των αγαθών στο μέρος ShipFrom];
146 [Εκτιμώμενη Ημερομηνία Εισόδου (Τελωνείο) ημερομηνία κατά την οποία αναμένεται η επίσημη ημερομηνία μιας Τελωνειακής Εισόδου.];
151 [Ημερομηνία Εισαγωγής (Άφιξη στο λιμάνι με πρόθεση να αποβιβαστούν];
186 Αναχωρεί από Εγκατάσταση ('Έξοδος από την Πύλη)];
204 [Ημερομηνία κατά την οποία τα Τελωνεία απελευθερώνουν τα εμπορεύματα στον μεταφορέα ή στον εισαγωγέα];
253 [Αναχωρεί από Λιμάνι ('Αναχώρηση Πλοίου')];
252 [Άφιξη σε Λιμάνι ('Άφιξη Πλοίου')];
283 [Άφιξη σε Εγκατάσταση ('Είσοδος στην Πύλη)];
342 [Φορτωμένη Μεταφορά];
351 [Επιθεώρηση Πύλης Τερματικού Σταθμού];
411 [Διαταγή Συμπλήρωσης];
412 [Διαταγή Αποσυναρμολόγησης];
420 [Αφορτωμένη Μεταφορά];
534 [Επισκευή];
677 [Επιβεβαίωση Συμπλήρωσης];
678 [Επιβεβαίωση Αποσυναρμολόγησης];
696 [Ημερομηνία Υποβολής].

Ημερομηνία, εκφρασμένη σε τροποποιημένη μορφή συμβατή με το UTC:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] όπου τα αγκύλες δηλώνουν προαιρετικότητα και το yyyy είναι το έτος, mmdd ο μήνας και η ημέρα, hhmmss η ώρα της ημέρας σε ώρες λεπτά και δευτερόλεπτα, fff τα κλάσματα δευτερολέπτων και poooo η διαφορά από το UTC εκφρασμένη σε ώρες και λεπτά, η διαφορά να είναι θετική αν το p είναι σημείο (.), αρνητική αν το P είναι πρόσημο μείον (-).
ΠΑΡΑΔΕΙΓΜΑ:
2005 - (UTC) ημερολογιακό έτος 2005;
200505 - (UTC) ημερολογιακός μήνας Μάιος 2005;
20050518 - (UTC) 18 Μαΐου 2005;
200505181247 - 12:47 UTC στις 18 Μαΐου 2005;
200505181247.0100 - 12:47 τοπική ώρα, δηλαδή 11:47 UTC, στις 18 Μαΐου 2005;
20050518124723099 - 99 χιλιοστά του δευτερολέπτου μετά τις 12:47:23 UTC στις 18 Μαΐου 2005.

Προσόντα Ημερομηνία, που αποτελείται από τη συνένωση των:
- ενός κωδικού εκδότη ISO/IEC 15459;
- ενός προσόντος ημερομηνίας που συμμορφώνεται με τις προδιαγραφές εκείνου του εκδότη;
- μιας ημερομηνίας της οποίας η μορφή και η ερμηνεία συμμορφώνονται με τις προδιαγραφές του εκδότη για εκείνο το προσόντο ημερομηνίας.

Όνομα Μέρους.
Όνομα ενός μέρους ακολουθούμενο από έναν χαρακτήρα πληθυντικού (+) ακολουθούμενο από έναν ή περισσότερους κωδικούς αξιών από τον κατάλογο κωδικών EDIFACT 3035 'Party Qualifier', π.χ·
BY [Αγοραστής];
CF [Χειριστής δοχείου];
CN [Παραλήπτης];
CS [Συμπυκνωτής];
DEI [Χειριστής πλοίου/καπετάνιος πλοίου];
FA [Κωδικός επιχειρησιακού προσωπικού];
IM [Εισαγωγέας];
MF [Κατασκευαστής];
OS [Αποστολέας];
SE [Πωλητής];
ST [Προς Αποστολή Σε];
UC [Τελικός παραλήπτης].

Αριθμός Παραλήπτη.
Ο μοναδικός αριθμός ταυτοποίησης μπορεί να είναι το IRS, EIN, SSN, ή ο αριθμός που έχει ανατεθεί από το CBP, όπως απαιτείται στη Φόρμα Ασφάλειας. Μόνο οι παρακάτω μορφές πρέπει να χρησιμοποιούνται: IRS EIN: NN-NNNNNNN;
IRS EIN με επίθημα:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP ανατεθειμένος αρ.: YYDDPP-NNNNN.
